import React, { Component } from 'react';
import Screen1 from './Screen1';
import Screen2 from './Screen2';
import axios from 'axios';
import './App.css';
class App extends Component{
	state = {
		'auth':false,
	}
	componentDidMount(){
		axios.get('http://127.0.0.1:8000/?format=json').then(res=>{
			if(!(res.data.length===0)){
				this.setState({'data':res.data[0],'auth':true});
				console.log(res.data[0]);
			}
		}).catch((err)=>{
			console.error(err);
		});
	}
	render(){
		return(
			<div className = 'container'>
				{!this.state.auth?<Screen1/>:<Screen2/>}
			</div>
		);
	}
}

export default App;
